import React from 'react';
import styled from 'styled-components';

const AboutContainer = styled.div`
  padding: 2rem;
  max-width: 800px;
  margin: 0 auto;
  color: white;
`;

const Title = styled.h1`
  color: #ff9000;
  margin-bottom: 2rem;
`;

const Content = styled.div`
  background-color: #1a1a1a;
  padding: 2rem;
  border-radius: 8px;
`;

const About = () => {
  return (
    <AboutContainer>
      <Title>About Me</Title>
      <Content>
        <center>
        <h2>Who I Am</h2>
        <p>
            <center>
            </center>
        </p>

        <h2>My Skills</h2>
        <p>
          • Frontend: React, JavaScript, HTML5, CSS3<br />
          • Backend: [Java]<br />
        </p>
        </center>
      </Content>
    </AboutContainer>
  );
};

export default About;
